$('#menu li').hover(

	function(){

			

			var listItems = $(this).children().children();

			var count = listItems.length;

			var width_menu = $('#menu').width();

			var width =	width_menu/count;

			

			$('ul.submenu li').css("width", width).css("padding", "7px 0")

			

		}

	

);



